import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";
import { DataGrid } from "@mui/x-data-grid";

const { client } = vendiaClient();


export const DevicePage = () => {

    const[testList, setTestList] = useState();

    useEffect(() => {
        const filterTests = async () => {
            const filteredTestList = await client.entities.test.list({
                filter: {
                  Device: {
                    contains: 'Device1',
                  }
                },
              })
            console.log(filteredTestList?.items);
            setTestList(filteredTestList?.items);

        }
        filterTests();
    }, [])

    const boolToString = (value) =>
    {
        if(typeof(value) === 'boolean')
            return 'true';
        else
            return 'false'
    }
    

    const columns = [
        {field: 'id', headerName: 'TestID'},
        {field: 'OrgAssignment', headerName: 'OrgAssignment'},
        {field: 'TestName', headerName: 'TestName'},
        {field: 'TestMethod', headerName: 'TestMethod'},
        {field: 'Notes', headerName: 'Notes'},
        {field: 'Completed', headerName: 'Completed'},
        {field: 'UpdatedBy', headerName: 'UpdatedBy'}
    ];

    
    return(
        
        <div className="DevicePage">
            <h1> Device1 </h1>
            <div>
            <DataGrid
            columns={columns}
/>
            </div>
            
            
        </div>

    )
}
